const fetch = require("node-fetch")

const icon = "data:image/png;base64,"

module.exports = {
    name: "cycdm",
    feature: {
        meta: { // 元信息，固定格式，在初始化过后应冻结
            tag: "cycdm", // 源的标签，要求与上层name相同
            name: "次元城动漫", // 源的实际名称，可以是任何字符串
            description: "次元城动漫源", // 源的描述
            version: "1.4", // 源的版本
            self: false, // 源的属性，是否为私有
            proxy: true, // 源代理配置，默认为true，所有内容走分布式后端代理
            icon,
            features: "basic"
        },
        
        data: { // 源活动数据
            vuesionCode: 6,
            base_url: "https://cycdm-1303090324.cos.ap-guangzhou.myqcloud.com/dtym.json",
            api_root: "",
        },

        async init(app) { // 源初始化函数
            // Do something here...
            try { // 初始化根API地址
                let res = await fetch(this.data.base_url)
                res = await res.json()
                let api_root = res[0]
                if (api_root.startsWith("https://")) {
                    this.data.api_root = api_root
                } else {
                    this.data.api_root = `https://${api_root}`
                }
                console.log("cycdm(init):", api_root)
            } catch (err) {
                console.error(err)
                console.warn("cycdm(init):", `using default api_root`)
                this.data.api_root = "https://app.95189371.cn"
            }
        },

        async getBangumiInfoByID(id) { // 根据id获取番剧信息
            let res = await fetch(`${this.data.api_root}/ciyuancheng.php/v${this.data.vuesionCode}/video_detail?id=${id}`)
            res = await res.json()

            const { vod_info } = res.data
            const play_list = {}
            vod_info.vod_url_with_player.forEach(ele => {
                const name = ele.name
                const list = []
                const url = ele.url
                url.split("#").forEach(text => {
                    list.push(text.split("$")[0])
                })
                play_list[name] = list
            })

            return {
                id: vod_info.vod_id,
                title: vod_info.vod_name,
                coverUrl: vod_info.vod_pic,
                description: vod_info.vod_content,
                tags: vod_info.vod_class,
                actor: vod_info.vod_actor,
                director: vod_info.vod_director,
                writer: vod_info.vod_writer,
                pubdate: vod_info.vod_pubdate,
                score: vod_info.vod_score,
                source: this.meta.tag,
                play_list,
                raw: vod_info.vod_url_with_player
            }
        },

        async getPlayUrl(id, line, episod) { // 根据id、播放列表（line）、集数（episod）获取播放链接
            let res = await fetch(`${this.data.api_root}/ciyuancheng.php/v${this.data.vuesionCode}/video_detail?id=${id}`)
            res = await res.json()

            const { vod_info } = res.data

            for (let index in vod_info.vod_url_with_player) {
                if (index == line) {
                    const line_info = vod_info.vod_url_with_player[index]
                    const perfix = line_info.un_link_features.split(",")
                    const parse_api = line_info.parse_api
                    let url = line_info.url.split("#")[episod].split("$")[1]
                    for (let i in perfix) {
                        if (url.includes(perfix[i])) {
                            let res = await fetch(`${parse_api}${url}`)
                            res = await res.json()
                            url = res.url
                        }
                    }
                    return {
                        path: url,
                        type: "video"
                    }
                }
            }
            return {
                path: '',
                type: "none"
            }
        },
    }
}